import React from 'react';
import ReactDOM from 'react-dom';

import Wheel from './components/spinwheel/spinwheel.js';
import ItemsList from './itemslist.js';

import './styles.css';

export class App extends React.Component {
  constructor() {
    super();
    this.items = new List(ItemsList);
  }

  render() {
    return (
      <div className="Spin">
        <Wheel items={this.items} />
        <h className="text1">Spin the wheel now to get reward</h>
        <h className="text2">Tap on spin or rotate the wheel anticlockwise and release to start spinning </h>
      </div>
    );
  }
}

const rootElement = document.getElementById('root');
ReactDOM.render(<App />, rootElement);
